import React from 'react';

function App() {
  return (
    <div className="min-h-screen bg-gradient-to-br from-primary-500 to-blue-600 flex items-center justify-center">
      <div className="text-white text-2xl font-bold">
        Chandrapal Singh Umath - Portfolio
      </div>
    </div>
  );
}

export default App;
